export default function Nav() {
    return (
        <nav aria-label="Main Navigation" role="navigation">
            <ul className="nav-list">
                <li><a style={{ color: "lightgray" }} href="...">Women's</a></li>
                <li><a style={{ color: "lightgray" }} href="...">Men's</a></li>
                <li><a style={{ color: "lightgray" }} href="...">On the Street</a></li>
                <li><a style={{ color: "lightgray" }} href="...">The Catwalk</a></li>
                <li><a style={{ color: "lightgray" }} href="...">AdWatch</a></li>
                <li><a style={{ color: "lightgray" }} href="...">About</a></li>
            </ul>
        </nav>
    );
}
